import React from 'react';
import './nav_bar.css';

interface iprops{
  en: string
  de: string
}


export default class Navbar extends React.Component{

  constructor(props:iprops){
    super(props)

    this.state={
      en: 'block',
      de: 'none'
    }



  }



  render(){
      return(
         <div className = "navbar_en" style={{display:"block"}}>
             <ul>
                  <li>Home</li>
                  <li>Objectives</li>
                  <li>Activities</li>
                  <li>Events</li>
                  <li>Membership</li>
                  <li>Organization</li>
                  <li>Contact</li>
                  <li><img className = 'lang_sel'src = {require('../images/de.png')} alt = 'Lang_Deutsch'/> </li>
                  <li><img className = 'lang_sel'src = {require('../images/uk.png')} alt = 'Lang_English'/> </li>
                  <li>History</li>
             </ul>

         </div>

      )

  }  

}
